import React from "react";
import {Link} from "react-router-dom";
import "./Header.css";
import logoIMG from "./Logo.gif";


class Navigation extends React.Component{
    
    state = {
        isLoading: true,
        results: [],
        value: "",
        name: ""
      };

    

    render() {
        return (
            <nav className = "header">
                <div className = "corp_name">
                    <img 
                    src = { logoIMG } 
                    alt = "HWASEON"
                    width = "210px"/>
                </div>
            </nav>
        );
        }
}



export default Navigation;
